INSERT INTO `_itoppriv_app_dashboards` VALUES (1,5,'WelcomeMenuPage','<?xml version=\"1.0\"?>\n<dashboard xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\">\n  <layout>DashboardLayoutOneCol</layout>\n  <title></title>\n  <auto_reload>\n    <enabled>false</enabled>\n    <interval>300</interval>\n  </auto_reload>\n  <cells>\n    <cell id=\"0\">\n      <rank>0</rank>\n      <dashlets>\n        <dashlet id=\"1\" xsi:type=\"DashletHeaderStatic\">\n          <rank>0</rank>\n          <title>Menu:ConfigManagementCI</title>\n          <icon>itop-welcome-itil/images/database.png</icon>\n        </dashlet>\n        <dashlet id=\"2\" xsi:type=\"DashletBadge\">\n          <rank>1</rank>\n          <class>BusinessProcess</class>\n        </dashlet>\n        <dashlet id=\"3\" xsi:type=\"DashletBadge\">\n          <rank>2</rank>\n          <class>ApplicationSolution</class>\n        </dashlet>\n        <dashlet id=\"4\" xsi:type=\"DashletBadge\">\n          <rank>3</rank>\n          <class>Contact</class>\n        </dashlet>\n        <dashlet id=\"5\" xsi:type=\"DashletBadge\">\n          <rank>4</rank>\n          <class>Location</class>\n        </dashlet>\n        <dashlet id=\"6\" xsi:type=\"DashletBadge\">\n          <rank>5</rank>\n          <class>Contract</class>\n        </dashlet>\n        <dashlet id=\"7\" xsi:type=\"DashletBadge\">\n          <rank>6</rank>\n          <class>Server</class>\n        </dashlet>\n        <dashlet id=\"8\" xsi:type=\"DashletBadge\">\n          <rank>7</rank>\n          <class>NetworkDevice</class>\n        </dashlet>\n      </dashlets>\n    </cell>\n    <cell id=\"1\">\n      <rank>1</rank>\n      <dashlets>\n        <dashlet id=\"11\" xsi:type=\"DashletHeaderDynamic\">\n          <rank>0</rank>\n          <title>Menu:RequestManagement</title>\n          <icon>itop-welcome-itil/images/user-request-deadline.png</icon>\n          <subtitle>Open Requests</subtitle>\n          <query>SELECT UserRequest WHERE status != \"closed\"</query>\n          <group_by>status</group_by>\n          <values>assigned,escalated_tto,escalated_ttr,new,resolved</values>\n        </dashlet>\n        <dashlet id=\"12\" xsi:type=\"DashletObjectList\">\n          <rank>1</rank>\n          <title>UI:WelcomeMenu:MyCalls</title>\n          <query>SELECT UserRequest AS i WHERE i.agent_id = :current_contact_id AND status NOT IN (\"closed\", \"resolved\")</query>\n          <menu>true</menu>\n        </dashlet>\n      </dashlets>\n    </cell>\n    <cell id=\"2\">\n      <rank>2</rank>\n      <dashlets>\n        <dashlet id=\"13\" xsi:type=\"DashletHeaderDynamic\">\n          <rank>0</rank>\n          <title>Service</title>\n          <icon>itop-service-mgmt-provider/images/service.png</icon>\n          <subtitle>Service</subtitle>\n          <query>SELECT Service</query>\n          <group_by>status</group_by>\n          <values></values>\n        </dashlet>\n      </dashlets>\n    </cell>\n    <cell id=\"3\">\n      <rank>3</rank>\n      <dashlets>\n        <dashlet id=\"14\" xsi:type=\"DashletBadge\">\n          <rank>0</rank>\n          <class>Contract</class>\n        </dashlet>\n        <dashlet id=\"15\" xsi:type=\"DashletBadge\">\n          <rank>1</rank>\n          <class>ServiceSubcategory</class>\n        </dashlet>\n        <dashlet id=\"16\" xsi:type=\"DashletBadge\">\n          <rank>2</rank>\n          <class>DeliveryModel</class>\n        </dashlet>\n        <dashlet id=\"17\" xsi:type=\"DashletBadge\">\n          <rank>3</rank>\n          <class>SLA</class>\n        </dashlet>\n        <dashlet id=\"18\" xsi:type=\"DashletBadge\">\n          <rank>4</rank>\n          <class>Contact</class>\n        </dashlet>\n        <dashlet id=\"19\" xsi:type=\"DashletBadge\">\n          <rank>5</rank>\n          <class>SLT</class>\n        </dashlet>\n      </dashlets>\n    </cell>\n    <cell id=\"4\">\n      <rank>4</rank>\n      <dashlets>\n        <dashlet id=\"0\" xsi:type=\"DashletEmptyCell\">\n          <rank>0</rank>\n        </dashlet>\n      </dashlets>\n    </cell>\n  </cells>\n</dashboard>\n'),(2,11,'UserRequest:Overview','<?xml version=\"1.0\"?>\n<dashboard xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\">\n  <layout>DashboardLayoutTwoCols</layout>\n  <title>UI:RequestMgmtMenuOverview:Title</title>\n  <auto_reload>\n    <enabled>true</enabled>\n    <interval>300</interval>\n  </auto_reload>\n  <cells>\n    <cell id=\"0\">\n      <rank>0</rank>\n      <dashlets>\n        <dashlet id=\"7\" xsi:type=\"DashletGroupByBars\">\n          <rank>0</rank>\n          <title>Escalated TTO\'s and TTR\'s</title>\n          <query>SELECT UserRequest WHERE status NOT IN (\'closed\',\'rejected\',\'assigned\',\'new\',\'resolved\',\'approved\')</query>\n          <group_by>status</group_by>\n          <style>bars</style>\n        </dashlet>\n      </dashlets>\n    </cell>\n    <cell id=\"1\">\n      <rank>1</rank>\n      <dashlets>\n        <dashlet id=\"2\" xsi:type=\"DashletGroupByBars\">\n          <rank>0</rank>\n          <title>UI-RequestManagementOverview-Last-14-days</title>\n          <query>SELECT UserRequest WHERE DATE_SUB(NOW(), INTERVAL 14 DAY) &lt; start_date</query>\n          <group_by>start_date:day_of_month</group_by>\n          <style>bars</style>\n        </dashlet>\n      </dashlets>\n    </cell>\n    <cell id=\"2\">\n      <rank>2</rank>\n      <dashlets>\n        <dashlet id=\"3\" xsi:type=\"DashletGroupByTable\">\n          <rank>0</rank>\n          <title>UI-RequestManagementOverview-OpenRequestByStatus</title>\n          <query>SELECT UserRequest WHERE status NOT IN (\'closed\',\'rejected\')</query>\n          <group_by>status</group_by>\n          <style>table</style>\n        </dashlet>\n      </dashlets>\n    </cell>\n    <cell id=\"3\">\n      <rank>3</rank>\n      <dashlets>\n        <dashlet id=\"4\" xsi:type=\"DashletGroupByTable\">\n          <rank>0</rank>\n          <title>UI-RequestManagementOverview-OpenRequestByAgent</title>\n          <query>SELECT UserRequest WHERE status NOT IN (\'closed\',\'rejected\')</query>\n          <group_by>agent_id</group_by>\n          <style>table</style>\n        </dashlet>\n      </dashlets>\n    </cell>\n    <cell id=\"4\">\n      <rank>4</rank>\n      <dashlets>\n        <dashlet id=\"5\" xsi:type=\"DashletGroupByTable\">\n          <rank>0</rank>\n          <title>UI-RequestManagementOverview-OpenRequestByType</title>\n          <query>SELECT UserRequest WHERE status NOT IN (\'closed\',\'rejected\')</query>\n          <group_by>finalclass</group_by>\n          <style>table</style>\n        </dashlet>\n      </dashlets>\n    </cell>\n    <cell id=\"5\">\n      <rank>5</rank>\n      <dashlets>\n        <dashlet id=\"6\" xsi:type=\"DashletGroupByTable\">\n          <rank>0</rank>\n          <title>UI-RequestManagementOverview-OpenRequestByCustomer</title>\n          <query>SELECT UserRequest WHERE status NOT IN (\'closed\',\'rejected\')</query>\n          <group_by>org_id</group_by>\n          <style>table</style>\n        </dashlet>\n      </dashlets>\n    </cell>\n    <cell id=\"6\">\n      <rank>6</rank>\n      <dashlets>\n        <dashlet id=\"9\" xsi:type=\"DashletObjectList\">\n          <rank>0</rank>\n          <title>New/Unassigned Requests</title>\n          <query>SELECT UserRequest WHERE status NOT IN (\'closed\',\'rejected\',\'approved\',\'escalated_tto\',\'escalated_ttr\',\'assigned\',\'resolved\')</query>\n          <menu>false</menu>\n        </dashlet>\n        <dashlet id=\"10\" xsi:type=\"DashletObjectList\">\n          <rank>1</rank>\n          <title>Assigned Requests Waiting For Resolution</title>\n          <query>SELECT UserRequest WHERE status NOT IN (\'closed\',\'rejected\',\'approved\',\'escalated_tto\',\'escalated_ttr\',\'new\',\'resolved\')</query>\n          <menu>false</menu>\n        </dashlet>\n      </dashlets>\n    </cell>\n    <cell id=\"7\">\n      <rank>7</rank>\n      <dashlets>\n        <dashlet id=\"8\" xsi:type=\"DashletObjectList\">\n          <rank>0</rank>\n          <title>Escalated TTR and TTO by Request</title>\n          <query>SELECT UserRequest WHERE sla_ttr_passed</query>\n          <menu>false</menu>\n        </dashlet>\n        <dashlet id=\"1\" xsi:type=\"DashletGroupByPie\">\n          <rank>1</rank>\n          <title>UI-RequestManagementOverview-RequestByType-last-14-days</title>\n          <query>SELECT UserRequest WHERE DATE_SUB(NOW(), INTERVAL 14 DAY) &lt; start_date</query>\n          <group_by>request_type</group_by>\n          <style>pie</style>\n        </dashlet>\n      </dashlets>\n    </cell>\n    <cell id=\"8\">\n      <rank>8</rank>\n      <dashlets>\n        <dashlet id=\"0\" xsi:type=\"DashletEmptyCell\">\n          <rank>0</rank>\n        </dashlet>\n      </dashlets>\n    </cell>\n    <cell id=\"9\">\n      <rank>9</rank>\n      <dashlets>\n        <dashlet id=\"0\" xsi:type=\"DashletEmptyCell\">\n          <rank>0</rank>\n        </dashlet>\n      </dashlets>\n    </cell>\n  </cells>\n</dashboard>\n');
